// SadqDashboard.js
import React from "react";
import { useAuth } from "./AuthProvider";
import HomePage from "./HomePage";

function LogoutButton() {
  const { logout } = useAuth();

  return (
    <button
      onClick={logout}
      className="mt-6 bg-red-500 hover:bg-red-600 text-white font-bold py-2 px-4 rounded"
    >
      Log Out
    </button>
  );
}

function SadqDashboard() {
  return (
    <div className="min-h-screen bg-white flex flex-col">
      {/* Header */}
      <header className="bg-blue-900 w-full py-4">
        <nav className="text-white text-sm max-w-6xl mx-auto flex justify-start gap-6 px-4">
          <a href="#" className="hover:underline">Home</a>
          <a href="#" className="hover:underline">Login</a>
          <a href="#" className="hover:underline">About</a>
          <a href="#" className="hover:underline">Contact</a>
        </nav>
      </header>

      {/* Main HomePage content */}
      <div className="bg-blue-900">
        <HomePage />
      </div>

      {/* Footer */}
      <footer className="text-center text-xs text-gray-600 py-6">
        <p className="mb-2">
          Â© 2025 Genki MD LLC<br />
          All rights reserved. Licensed use only.<br />
          This tool is for workflow support only. Providers are responsible for final admission and care decisions.
        </p>
        <LogoutButton />
      </footer>
    </div>
  );
}

export default SadqDashboard;
